pragma solidity ^0.8.9;
import "./CrowdsaleBase.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title DefaultCrowdsale
 * @dev This is an example of a fully fledged crowdsale.
 */
contract VestingCrowdsale is CrowdsaleBase, Ownable {
    uint internal _currentRateIndex;
    string internal _currentStage;
    string[] internal _names;
    uint256[] internal _rates;
    uint256[] internal _caps;
    bool[] internal _privateSales;
    

    constructor(
        address payable wallet,
        IERC20 token,
        string[] memory names, 
        uint256[] memory rates,
        uint256[] memory caps, 
        bool[] memory privateSales
    ) CrowdsaleBase(rates[0], wallet, token) {
        _currentRateIndex = 0;
        _privateSales = privateSales;
        _caps = caps;
        _names = names;
        _rates = rates;
    }

     /**
    * @dev Change funding to next rate value
    */
    function setNextRate() public onlyOwner returns (bool success) {
        require(_currentRateIndex + 1 < _rates.length);
        _currentRateIndex += 1;
        super._updateRate(_rates[_currentRateIndex]);
        return true;
    }

    function stage() public view returns (string memory) {
        return _names[_currentRateIndex];
    }

    function cap() public view returns (uint256) {
        return _caps[_currentRateIndex];
    }

}
